import React from "react";
import { useState } from "react";
const Compteur = ({start,}) => {
    const [compteur, setCompteur] = useState(0);
    return (
        <div>
            <div>
                <button
                    onClick={() => {
                        setCompteur(compteur + 1);
                    }}>
                    compteur + 1
                </button>
            </div>
            {<div>compteur = {compteur}</div>}
        </div>
    );
};
export default Compteur
